import { useEffect,useState } from "react"
import {  useNavigate } from "react-router-dom"

function App(){
 
    const[fet,setFet]=useState([])
    const navigate=useNavigate()
    useEffect(()=>{
        fetch("http://localhost:3006/learn")
        .then((jos)=>{
           return jos.json()
        })
        .then((das)=>{
            setFet(das)
        }) 

    },[])

  




   return(
    <div className="container">
        <div className="card">
            <div className="card-title">
                  <h2>The Table System</h2>
            </div>
                <div className="card-body">

                   <div>
                              {fet.map((one)=>(
                                <ul>
                                    <li>{one.id}</li>
                                    <li>{one.name}</li>
                                    <li>{one.age}</li>
                                    <li>{one.email}</li>
                                    <li>{one.mobille}</li>
                                    <li>{one.city}</li>
                                    </ul>

                            
                                      
                              ))}
                    </div>    
                </div>
           
        </div>
    </div>
   )
}

export default App;
